import React,{useState, useEffect} from 'react';
// import NavTimeline from './NavTimeline'
import axios from 'axios'
import RightTimeline from './RightTimeline/RightTimeline'
import LeftTimeline from './LeftTimeline/LeftTimeline'
import ProfileTimeline from './LeftTimeline/ProfileTimeline'

// import FooterTimeline from './FooterTimeline'

function Timeline(){

  const [post,setPost] = useState([])

    useEffect(()=>{	
	    axios.get('http://localhost:4444/Timeline').then((response)=>{
			console.log(response.data);
			setPost(response.data)

	    })
      },[])



    return(
        <div>
          <meta charSet="utf-8" />
        <title>Home</title>

          <div className="container">
          <div className="content">

          <RightTimeline />
          <div className="content_lft">
          <ProfileTimeline/>
          <div className="contnt_2">
                <div className="div_a">
                  {post.map((item)=>{
                    return(
                      <div>
                      <div className="div_title">User Interface PSD Source files Web Designing for web</div>
                      <div className="btm_rgt">
                        <div className="btm_arc">Cats</div>
                      </div>
                      <div className="div_top">
                        <div className="div_top_lft"><img src="images/img_6.png" />Steave Waugh</div>
                        <div className="div_top_rgt"><span className="span_date">02 Jan 2014</span><span className="span_time">11:15am</span></div>
                      </div>
                      <div className="div_image"><img src={`http://localhost:4444/${item.image}`} alt="pet" />

                      <div className="div_btm">
                    <div className="btm_list">
                      <ul>
                        <li><a href="#"><span className="btn_icon"><img src="images/icon_001.png" alt="share" /></span>Share</a></li>
                        <li><a href="#"><span className="btn_icon"><img src="images/icon_002.png" alt="share" /></span>Flag</a></li>
                        <li><a href="#"><span className="btn_icon"><img src="images/icon_003.png" alt="share" /></span>0 Likes</a></li>
                        <li><a href="#"><span className="btn_icon"><img src="images/icon_004.png" alt="share" /></span>4 Comments</a></li>
                      </ul>
                    </div>
                  </div>                  
                      </div>                    
                        </div>
                )
                  })}

                    </div>
                  </div>
          </div>
          {/* <LeftTimeline /> */}
          </div>
          <div className="clear" />

          </div>

      </div>
    )
}
export default Timeline;
